	width: 100vw;
	height: 100vw;
	background-image: linear-gradient(90deg, #002F52 35%, #326589);
`
function Home() {
  return (
		<AppContainer className='App'>
			<Pesquisa />
			<UltimosLancamentos />
    </AppContainer>
  );
}

export default Home;
